import React from 'react'
const Card = (props) => {
  return (

    <div>
      <img
        className={styles.Image}
        src="/images/creative.png"
        alt="Next.js Logo"
        
      />
      <h2>
        {props.title}
      </h2>
      <p>
        {props.soustitle}
      </p>
      <h6>{props.signature}</h6>

    </div>






  )
}

export default Card
